import { Component, OnInit } from '@angular/core';
import { AngularFireStorage } from '@angular/fire/compat/storage';
import { AngularFirestore } from '@angular/fire/compat/firestore';
import { ToastController } from '@ionic/angular';
import { AddMedecin } from  'src/firebaseConfig'; // Assurez-vous d'importer AddMedecin correctement

@Component({
  selector: 'app-signup-medecin',
  templateUrl: './signup-medecin.page.html',
  styleUrls: ['./signup-medecin.page.scss'],
})
export class SignupMedecinPage implements OnInit {

  selectedFile: File | null = null;
  selectedFileUrl: string | null = null;



  familyName = "";
  name = "";
  email = "";
  password = "";
  date = "";
  sexe = "";
  localisation = "";
  specialite = "";
  role = "medecin";
  telephone = "";

  constructor(
    private firestore: AngularFirestore,
    private storage: AngularFireStorage,
    private toastController: ToastController
  ) { }

  onFileSelected(event: any) {
    const file: File | null = event.target.files[0];
    if (file) {
      this.selectedFile = file;
      this.selectedFileUrl = URL.createObjectURL(this.selectedFile); // Obtenez l'URL de l'image sélectionnée
      console.log("url image", this.selectedFileUrl);
    }
  }

  async presentToast(message: string) {
    const toast = await this.toastController.create({
      message: message,
      duration: 3000,
      position: 'bottom',
    });
    toast.present();
  }

  ngOnInit() {}

  async AddUser() {
    try {
      const file = this.selectedFile;
      await AddMedecin(
        this.firestore,
        this.storage,
        this.familyName,
        this.name,
        this.email,
        this.password,
        this.date,
        this.sexe,
        this.role,
        this.specialite,
        this.localisation,
        this.telephone,
        file
      );
      this.presentToast('Registration successful!');
      this.resetForm(); // Réinitialiser le formulaire après l'ajout réussi
    } catch(error) {
      console.log('Error during registration:', error);
      this.presentToast('Error during registration.');
    }
  }

  resetForm() {
    this.familyName = '';
    this.name = '';
    this.email = '';
    this.password = '';
    this.localisation = '';
    this.specialite = '';
    this.date = '';
    this.sexe = '';
    this.telephone = '';
    this.selectedFile = null;
  }
}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-button slot="start">
      <ion-back-button text="Retour" routerLink="/homemedecin">Retour
      </ion-back-button>
    </ion-button>
    <ion-title>Inscription</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content>
  <ion-grid>
    <ion-row class="justify-content-center">
     <ion-col>
      <div class="ion-text-center">
        <br><br><br><br>
        <h4>Register Form medecin</h4>
      </div><br><br><br><br>
      <div class="form">
        <form>
        <ion-item>
          <ion-input [(ngModel)]="familyName" placeholder="Enter your family name" type="text"  name="familyName" [ngModelOptions]="{standalone: true}">
            <ion-icon name="person-outline"></ion-icon>
          </ion-input>
        </ion-item><br>
        <ion-item>
          <ion-input [(ngModel)]="name" placeholder="Enter your name" type="text"  name="name">
            <ion-icon name="person-outline"></ion-icon>
          </ion-input>
        </ion-item><br>

        <ion-item>
          <ion-input [(ngModel)]="specialite" placeholder="Entrer votre specialite" type="text"  name="specialite">
            <ion-icon name="clipboard-outline"></ion-icon>
            </ion-input>
          </ion-item>
          <br>
          <ion-item>
            <label for="etats_tunisie">Sélectionnez un État de la Tunisie :</label>
    <select id="etats_tunisie" name="etats_tunisie">
        <option value="Ariana">Ariana</option>
        <option value="Beja">Béja</option>
        <option value="Ben Arous">Ben Arous</option>
        <option value="Bizerte">Bizerte</option>
        <option value="Gabes">Gabès</option>
        <option value="Gafsa">Gafsa</option>
        <option value="Jendouba">Jendouba</option>
        <option value="Kairouan">Kairouan</option>
        <option value="Kasserine">Kasserine</option>
        <option value="Kebili">Kébili</option>
        <option value="Le Kef">Le Kef</option>
        <option value="Mahdia">Mahdia</option>
        <option value="La Manouba">La Manouba</option>
        <option value="Médenine">Médenine</option>
        <option value="Monastir">Monastir</option>
        <option value="Nabeul">Nabeul</option>
        <option value="Sfax">Sfax</option>
        <option value="Sidi Bouzid">Sidi Bouzid</option>
        <option value="Siliana">Siliana</option>
        <option value="Sousse">Sousse</option>
        <option value="Tataouine">Tataouine</option>
        <option value="Tozeur">Tozeur</option>
        <option value="Tunis">Tunis</option>
        <option value="Zaghouan">Zaghouan</option>
    </select>
            </ion-item>
            <br>
        <ion-item>
          <ion-input [(ngModel)]="email" placeholder="Enter email" type="email"  name="email">
            <ion-icon name="mail-outline"></ion-icon>
          </ion-input>
        </ion-item>
        <br>
        <ion-item>
          <ion-input [(ngModel)]="telephone" placeholder="Entrer votre numéro de téléphone" type="text"  name="telephone">
            <ion-icon name="call-outline"></ion-icon>
            </ion-input>
          </ion-item>
          <br>
        <ion-item>
        <ion-input [(ngModel)]="password" placeholder="Enter password" type="password" spellcheck="false" name="password">
          <ion-icon name="lock-closed-outline"></ion-icon></ion-input>
        </ion-item>
        <br>
        <ion-item>
          <ion-input [(ngModel)]="date" placeholder="Enter date" type="date"  name="date">
            </ion-input>
          </ion-item>
          <br>
          <ion-item>
            <label for="fileInput">Upload File</label>
            <input type="file" id="fileInput" name="fileInput" accept="*/*" (change)="onFileSelected($event)">
            <div *ngIf="selectedFile">
              <img [src]="selectedFileUrl" alt="Selected Image">
            </div>
          </ion-item>
          <br>
        </form>
      </div>
      <label>
        <input type="radio" [(ngModel)]="sexe"  name="sexe" value="Masculin"> Masculin
      </label>
      <label>
        <input type="radio" [(ngModel)]="sexe"  name="sexe" value="Féminin"> Féminin
      </label>
      <br>
      <div padding>
        <br><br><br><br>

        <ion-button size="large" expand="block" (click)="AddUser()" >Register</ion-button>
      </div>
     </ion-col>
    </ion-row>
  </ion-grid>
</ion-content>
